{
  "task_id": "equities_amd_price_desc_v1",
  "user_prompt": "What does AMD do, and what is its current price and 1-day change? Answer in ≤120 words with one short citation to a source.",
  "complexity": "simple",
  "max_turns": 4,
  "tools_available": [
    "polygon_get_aggs",
    "polygon_get_news",
    "fmp_get_quote",
    "fmp_get_income_statement",
    "fmp_get_company_profile",
    "tavily_search",
    "tavily_extract",
    "send_slack_message",
    "list_slack_channels",
    "execute_python",
    "process_mcp_data"
  ],
  "limits": {
    "max_tools": 5,
    "max_servers": 5
  },
  "tool_sequence": [
    {
      "step": 1,
      "server": "fmp",
      "tool": "fmp_get_quote",
      "params": {
        "symbol": "AMD"
      },
      "analysis_requirements": {
        "extract": [
          "price",
          "changesPercentage"
        ],
        "compute": [],
        "select": [],
        "accept_if": [
          "price is not None",
          "changesPercentage is not None"
        ]
      }
    },
    {
      "step": 2,
      "server": "fmp",
      "tool": "fmp_get_company_profile",
      "params": {
        "symbol": "AMD"
      },
      "analysis_requirements": {
        "extract": [
          "description",
          "industry",
          "sector"
        ],
        "compute": [],
        "select": [],
        "accept_if": [
          "description is not None"
        ]
      }
    }
  ],
  "final_answer_requirements": {
    "format": "text",
    "must_include": [
      "company_description",
      "current_price",
      "one_day_change"
    ],
    "grounded_from": [
      "description",
      "price",
      "changesPercentage"
    ],
    "quality_criteria": [
      "no hallucinations",
      "concise",
      "<=120 words",
      "include one short citation to a source"
    ]
  },
  "judge_rubric": {
    "weights": {
      "coverage": 0.4,
      "grounding": 0.3,
      "clarity": 0.2,
      "safety": 0.1
    },
    "target_length_range": [
      10,
      120
    ]
  }
}
